import React, { useState, useEffect } from "react";

const hospitalData = [
  {
    "name": "ABC Hospital",
    "address": "123 Main St",
    "phone": "99XXXX99XX",
    "type": "Hospital",
    "image": "hospital1.jpg"
  },
  {
    "name": "ABC Clinic",
    "address": "456 Oak St",
    "phone": "99XXXX99XX",
    "type": "Clinic",
    "image": "clinic1.jpg"
  }
  
];

const HospitalClinicList = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("/hospitals.json")
      .then((response) => response.json())
      .then((data) => {
        setHospitalData(data);
        setResults(data);
        console.log(data)
      });
  }, []);

  return (
    <div className="p-6">
      <div className="mb-6">
        <h2 className="text-xl font-semibold mb-4">Hospitals Nearby</h2>
        <div className="grid grid-cols-2 gap-4">
          {data
            .filter(item => item.type === "Hospital")
            .map((hospital, index) => (
              <div key={index} className="flex bg-teal-200 p-4 rounded-lg">
                <div className="w-1/3 bg-gray-300 rounded-lg">
                  <img src={hospital.image} alt={hospital.name} className="w-full h-full object-cover rounded-lg"/>
                </div>
                <div className="w-2/3 pl-4">
                  <h3 className="font-bold">{hospital.name}</h3>
                  <p>{hospital.address}</p>
                  <p>Ph. No.: {hospital.phone}</p>
                </div>
              </div>
            ))}
        </div>
      </div>

      <div className="mb-6">
        <h2 className="text-xl font-semibold mb-4">Clinics Nearby</h2>
        <div className="grid grid-cols-2 gap-4">
          {data
            .filter(item => item.type === "Clinic")
            .map((clinic, index) => (
              <div key={index} className="flex bg-teal-200 p-4 rounded-lg">
                <div className="w-1/3 bg-gray-300 rounded-lg">
                  <img src={clinic.image} alt={clinic.name} className="w-full h-full object-cover rounded-lg"/>
                </div>
                <div className="w-2/3 pl-4">
                  <h3 className="font-bold">{clinic.name}</h3>
                  <p>{clinic.address}</p>
                  <p>Ph. No.: {clinic.phone}</p>
                </div>
              </div>
            ))}
        </div>
      </div>
    </div>
  );
};

export default HospitalClinicList;
